import React, { Component } from 'react';
import Videos from "../assets/Data/videos.json";

export default class VideoQue extends Component {
    render() {
        Videos.map((videoQue, i)=> {
            return (
            <section className='video__que__section'>
                
                <div className='video__que__thumb'></div>
                <div className='video__que__side'>
                <div className='video__que__side--title'></div>
                <div className='video__que__side--user'></div>
                </div>
            </section>
        )
        })
        return 
    }
}
